import { mobileAdministration } from "../../../../env/environment";
import { verifyIsVisible, mobileAdministrationSelectCompany } from "../../../../pageobjects/common/Common.page";
import { MobileAdminGP } from "../../../../pageobjects/mobile-administration/GP";

describe("PARTNERS TESTS", () => {

    it("Open new Shop page, verify page does not crash", () => {
        mobileAdministration();
        MobileAdminGP.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
        mobileAdministrationSelectCompany("label=TW / sdg");
        MobileAdminGP.menuItems.PartnersMenuItem.click();

        MobileAdminGP.partners.transactionHistoryBtn.click();
        verifyIsVisible(MobileAdminGP.partners.filterBtn);
    });

    it("Filter results, verify results are loaded", () => {
        MobileAdminGP.partners.filterBtn.click();
        const resultTable = $('.card--table');
        resultTable.waitForDisplayed();
        verifyIsVisible(resultTable);
    });

});

