        get passwordInput() {
            return $("[name='password']");
        },
        get confirmPasswordInput() {
            return $("[name='confirmPassword']");
        },
        get firstnameInput() {
            return $("[name='firstName']");
        },
        get lastNameInput() {
            return $("[name='lastName']");
        },
        get emailInput() {
            return $("[name='email']");
        },
        get addMailBtn() {
            return $(".card--email button");
        },
        selectshop(central, agency, shop) {
            const selectCentral = $(".rc-tree-list-holder-inner").$(`span*=${central}`);
            selectCentral.waitForClickable();
            selectCentral.click();

            const selectAgency = $(".rc-tree-list-holder-inner").$(`span*=${agency}`);
            selectAgency.waitForClickable();
            selectAgency.click();

            const selectShop = $(".rc-tree-list-holder-inner").$(`span*=${shop}`);
            selectShop.waitForClickable();
            selectShop.click();
        },
    }

    depositWithdrawal = {

        get userInput() {
            return $("[name='user']");
        },
        get roleDropdown() {
            return $(".dropdown--multi__toggle");
        },
        get searchBtn() {
            return $("button[title='Search'] > .btn__label");
        },

        selectRole(role) {
            this.roleDropdown.click();
            $(".dropdown--multi__body")
                .$(`span*=${role}`).click();
            this.roleDropdown.click();
        },
        get depositBtn() {
            return $("button[title='Deposit']");
        },
        get payoutBtn() {
            return $("button[title='Payout']");
        },
        get detailTab() {
            return $(".tabs--primary").$("a=Details");
        },
        get lastTransactionsTab() {
            return $(".tabs--primary").$("a=Last transactions");
        }
    }

    shopManagement = {

        selectshop(central, agency, shop) {
            const selectCentral = $(".rc-tree-list-holder-inner").$(`span*=${central}`);
            selectCentral.waitForClickable();
            selectCentral.click();

            const selectAgency = $(".rc-tree-list-holder-inner").$(`span*=${agency}`);
            selectAgency.waitForClickable();
            selectAgency.click();

            const selectShop = $(".rc-tree-list-holder-inner").$(`span*=${shop}`);
            selectShop.waitForClickable();
            selectShop.click();
        },
        get activeShopBtn() {
            return $("span=Yes");
        },
        get inactiveShopBtn() {
            return $("span=No");
        }

    }


}

