import { mobileAdministration } from "../../../../env/environment";
import { mobileAdministrationSelectCompany, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminGP } from "../../../../pageobjects/mobile-administration/GP";
describe("MOBILE ADMIN - FINANCES OVERVIEW", () => {

    describe("FINANCES OVERVIEW TESTS", () => {
        it("Open new finances overview page, verify page does not crash", () => {
            mobileAdministration();
            MobileAdminGP.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationSelectCompany();
            MobileAdminGP.menuItems.financesOverviewMenuItem.click();
            verifyIsVisible(MobileAdminGP.financesOverview.financesOverviewBtn);
        });

        it("Verify report is loaded", () => {
            MobileAdminGP.financesOverview.financesOverviewBtn.click();
            $("button=Select all").waitForClickable();
            $("button=Select all").click();
            $("button=Display").click();
            verifyIsVisible($("th=SPORTS BETTING"))
        });

    });
});

