import { administration } from "../../env/environment";
import { UsersPage } from "../../pageobjects/administration.page";
import LoginPage from "../../pageobjects/administration.page/Login.page";
import SideMenuPage from "../../pageobjects/administration.page/SideMenu.page";
import { verifyIsVisible } from "../../pageobjects/common/Common.page";

describe("Users test", () => {
    const username = "SuperAdmin";
    const password = "B@@sicSup3rAdm1n";

    it("Open Users page", () => {
        administration();
        browser.maximizeWindow();
        LoginPage.usernameInput.setValue(username);
        LoginPage.passwordInput.setValue(password);
        LoginPage.signInBtn.click()
        SideMenuPage.usersButton.waitForDisplayed();
        verifyIsVisible(SideMenuPage.usersButton);
        SideMenuPage.usersButton.click();
        const userDetailsSideMenu = $("a=User Details");
        userDetailsSideMenu.click();
        verifyIsVisible(UsersPage.createNewAgencyUserBtn);
    });


    it("Verify Create Organization users button is visible", () => {
        verifyIsVisible(UsersPage.createNewOrganizationUser);
    });

    it("Verify Create Agency users button is visible", () => {
        verifyIsVisible(UsersPage.createNewAgencyUserBtn);
    });

    it("", () => {
        const searchInput = $(".field--search__wrapper [type]");
        searchInput.addValue("at001");
        browser.pause(5000);
    });

});

