import { mobileAdministrationSelectCompany, randomStringNum, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminGP } from "../../../../pageobjects/mobile-administration/GP";
describe("MOBILE ADMIN - SHOP", () => {
    describe("NEW SHOP TESTS", () => {

        it("Open new Shop page, verify page does not crash", () => {
            mobileAdministration();
            MobileAdminGP.login.usernameInput.addValue("SuperAdmin");
            MobileAdminGP.login.passwordInput.addValue("B@@sicSup3rAdm1n");
            MobileAdminGP.login.signInBtn.click();
            mobileAdministrationSelectCompany();
            MobileAdminGP.menuItems.shopMenuItem.click();
            verifyIsVisible(MobileAdminGP.shop.main.newCashierBtn);
            verifyIsVisible(MobileAdminGP.shop.main.depositWithdrawalBtn);
            verifyIsVisible(MobileAdminGP.shop.main.newShopPartnerBtn);
            verifyIsVisible(MobileAdminGP.shop.main.shopManagementBtn);
            verifyIsVisible(MobileAdminGP.shop.main.newShopBtn);
            MobileAdminGP.shop.main.newShopBtn.click();
        });

        it("Select central, verify agencies are loaded", () => {
            MobileAdminGP.shop.newShop.selectCentral("HR Central");
            verifyIsVisible(MobileAdminGP.shop.newShop.centralTitle);
        });

        it("Create shop, verify it is a success", () => {
            browser.url('http://qa.gp.m.admin.gp.develop/platform/agency-central-list');

            const agency = $("span*=MonoQA");
            const central = $("span*=HR Central");

            central.waitForClickable();
            central.click();
            agency.waitForClickable();
            agency.click();
            MobileAdminGP.shop.newShop.addNewShopBtn.click();
            const randomShop = `Autoshop${randomStringNum()}`;
            MobileAdminGP.shop.newShop.shopNameInput.addValue(randomShop);
            MobileAdminGP.shop.newShop.shopAddressInput.addValue("addrX");
            MobileAdminGP.shop.newShop.pinNumberInput.addValue("1111");
            MobileAdminGP.shop.newShop.saveBtn.click();
            verifyIsVisible(MobileAdminGP.shop.newShop.shopCreatedToastMessage);

            const createdShop = $(".nav--linkbox--inline").$(`div*=${randomShop}`);
            createdShop.waitForDisplayed();
            verifyIsVisible(createdShop);

        });


    });
    describe("NEW SHOP PARTNER TESTS", () => {

        it("Open new Shop partner page, verify page does not crash", () => {

            MobileAdminGP.menuItems.shopMenuItem.click();
            verifyIsVisible(MobileAdminGP.shop.main.newCashierBtn);
            verifyIsVisible(MobileAdminGP.shop.main.depositWithdrawalBtn);
            verifyIsVisible(MobileAdminGP.shop.main.newShopPartnerBtn);
            verifyIsVisible(MobileAdminGP.shop.main.shopManagementBtn);
            verifyIsVisible(MobileAdminGP.shop.main.newShopBtn);
            MobileAdminGP.shop.main.newShopPartnerBtn.click();
        });

        it("Verify shop partner creation page", () => {
            verifyIsVisible(MobileAdminGP.shop.newShopPartner.usernameInput);
            verifyIsVisible(MobileAdminGP.shop.newShopPartner.confirmPasswordInput);
            verifyIsVisible(MobileAdminGP.shop.newShopPartner.passwordInput);
            verifyIsVisible(MobileAdminGP.shop.newShopPartner.firstNameInput);
            verifyIsVisible(MobileAdminGP.shop.newShopPartner.lastNameInput);
        });

        it("Verify partner is created", () => {
            MobileAdminGP.shop.newShopPartner.usernameInput.addValue(`partner${randomStringNum()}`);
            MobileAdminGP.shop.newShopPartner.passwordInput.addValue('mono.123');
            MobileAdminGP.shop.newShopPartner.confirmPasswordInput.addValue('mono.123');
            MobileAdminGP.shop.newShopPartner.firstNameInput.addValue("aeifha");
            MobileAdminGP.shop.newShopPartner.lastNameInput.addValue("adfawf");
            MobileAdminGP.shop.newShopPartner.selectshop("HR Central", "MonoQA", "Vanja");
            MobileAdminGP.shop.newShopPartner.saveBtn.click();

            verifyIsVisible($("div*=Agency Partner created successfully"));

        });

    });

    describe("NEW CASHIER TESTS", () => {
        it("Open new Shop partner page, verify page does not crash", () => {

            MobileAdminGP.menuItems.shopMenuItem.click();
            verifyIsVisible(MobileAdminGP.shop.main.newCashierBtn);
            verifyIsVisible(MobileAdminGP.shop.main.depositWithdrawalBtn);
            verifyIsVisible(MobileAdminGP.shop.main.newShopPartnerBtn);
            verifyIsVisible(MobileAdminGP.shop.main.shopManagementBtn);
            verifyIsVisible(MobileAdminGP.shop.main.newShopBtn);
            MobileAdminGP.shop.main.newCashierBtn.click();
        });

        it("Verify new cashier page", () => {
            verifyIsVisible(MobileAdminGP.shop.newCashier.usernameInput);
            verifyIsVisible(MobileAdminGP.shop.newCashier.passwordInput);
            verifyIsVisible(MobileAdminGP.shop.newCashier.confirmPasswordInput);
