import { webML } from "../../../../env/environment";
import { randomShortStringNum, randomStringNum, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { EmailChange, loginWebV1Page, MenuItemsPage } from "../../../../pageobjects/web-v1";

describe("Web ML email change tests", () => {

    const username = "at-mail-ml";
    const password = "pass.1234";

    it("Open email address change page, verify page is opened", () => {
        webML();
        browser.maximizeWindow();
        loginWebV1Page.usernameInput.addValue(username);
        loginWebV1Page.passwordInput.addValue(password);
        loginWebV1Page.signInBtn.click();
        verifyIsVisible(loginWebV1Page.logoutBtn);
        MenuItemsPage.accountSettingsBtn.click();
        EmailChange.emailChangeTab.click();
    });

    it("Verify email address change page elements", () => {
        verifyIsVisible(EmailChange.currentEmailaddressLabel);
        verifyIsVisible(EmailChange.newEmailAddressInput);
        verifyIsVisible(EmailChange.newEmailAddressLabel);
        verifyIsVisible(EmailChange.emailAddressAvailabilityLabel);
        verifyIsVisible(EmailChange.repeatEmailAddressInput);
        verifyIsVisible(EmailChange.repeatEmailAddressLabel);
    });

    it("Enter invalid confirmation password, verify error message", () => {
        let randomNewEmail = `${randomShortStringNum()}@ma.il`;
        const confirmPasswordSaveBtn = $("#submit");
        EmailChange.emailChangeTab.click();
        EmailChange.newEmailAddressInput.addValue(randomNewEmail);
        EmailChange.repeatEmailAddressInput.addValue(randomNewEmail);
        EmailChange.saveBtn.click();
        EmailChange.passwordConfirmationInput.waitForClickable();
        EmailChange.passwordConfirmationInput.addValue('nekipassworD.123');
        confirmPasswordSaveBtn.click();
        verifyIsVisible(EmailChange.incorrectPasswordMessage);
        const errorModalCloseBtn = $("#errorPopup .btn--icon-left");
        errorModalCloseBtn.waitForClickable();
        errorModalCloseBtn.click();
        verifyIsVisible(EmailChange.emailChangeTab);
    });

    it("Cancel the password change process, verify previous elements are saved", () => {
        let randomNewEmail = `${randomShortStringNum()}@ma.il`;
        EmailChange.emailChangeTab.click();
        EmailChange.newEmailAddressInput.addValue(randomNewEmail);
        EmailChange.repeatEmailAddressInput.addValue(randomNewEmail);
        EmailChange.saveBtn.click();
        EmailChange.passwordConfirmationInput.waitForDisplayed();
        EmailChange.passwordConfirmationInput.addValue(password);
        EmailChange.confirmPasswordCancelBtn.click();

        const validIcon = $(".jqInputValid span");
        verifyIsVisible(validIcon);
        verifyIsVisible(EmailChange.emailChangeTab);
        EmailChange.emailChangeTab.click();
    });

    it("Add valid new email, verify valid message exists", () => {

        let randomNewEmail = `${randomShortStringNum()}@${randomShortStringNum()}.il`;
        const availableEmailValueMessage = $("#availableEmailValue");

        EmailChange.newEmailAddressInput.addValue(randomNewEmail);
        EmailChange.repeatEmailAddressInput.addValue(randomNewEmail);
        EmailChange.newEmailAddressLabel.click();
        verifyIsVisible(availableEmailValueMessage);
        verifyIsVisible(EmailChange.emailChangeTab);
        EmailChange.emailChangeTab.click();
    });

    it("Successfull email change, verify email is updated", () => {
        let randomNewEmail = `${randomShortStringNum()}@${randomShortStringNum()}.il`;
        const confirmPasswordSaveBtn = $("#submit");

        EmailChange.newEmailAddressInput.addValue(randomNewEmail);
        EmailChange.repeatEmailAddressInput.addValue(randomNewEmail);
        EmailChange.saveBtn.click();
        EmailChange.passwordConfirmationInput.waitForClickable();
        EmailChange.passwordConfirmationInput.addValue(password);
        confirmPasswordSaveBtn.click();

        verifyIsVisible(EmailChange.infoSuccessModal);
        EmailChange.infoModalCloseBtn.waitForClickable();
        EmailChange.infoModalCloseBtn.click();
        verifyIsVisible(EmailChange.emailChangeTab);
        EmailChange.emailChangeTab.click();
    });



});

