import { mobileAdministrationLogout, mobileTwAdministrationLogout } from "../../common/Common.page";

class MobileAdminTW {

    cashRegister = {
        get newPlayerBtn() {
            return $(".nav--linkbox").$("div=New player");
        },
        newPlayer: {
            get createBtn() {
                return $("button[title='Create']");
            },
            get username() {
                return $("[name='userName']");
            },
            get password() {
                return $("[name='password']");
            },
            get createAccountBtn() {
                return $("button[title='Create Account']");
            }
        },
        get cashierSettlementBtn() {
            return $(".nav--linkbox").$("div=Cashier settlement");
        },
        casherSettlement: {
            get settleUpButton() {
                return $("span=Settle up");
            },
            get exitAmountInput() {
                return $(".input.input--base.is-floating");
            }
        }
    }

    financesOverview = {
        get financesOverviewBtn() {
            return $(".nav--linkbox").$("div=Finances overview");
        }
    }

    home = {
        get logoutBtn() {
            return $("span=Logout");
        }
    }

    menuItems = {

        menu: {

            get betsMenuItem() {
                return $(".l--nav").$('span=Bets');
            },
            get userActivitiesMenuItem() {
                return $(".l--nav").$('span=User activities');
            },
            get PartnersMenuItem() {
                return $(".l--nav").$('span=Partners');
            },
            get logOutMenuItem() {
                return $(".l--nav").$('span=Logout');
            },

        },
        get menuBtn() {
            return $(".l--nav").$('span=Menu');
        },

