            get newAgentPartnerBtn() {
                return $(".nav--linkbox").$('div=New agent partner');
            },
            get editPartnerBtn() {
                return $(".nav--linkbox").$('div=Edit partner');
            },
            get depositWithdrawalBtn() {
                return $(".nav--linkbox").$('div=Deposit / Withdrawal');
            },
            get agencyManagementBtn() {
                return $(".nav--linkbox").$('div=Agency management');
            }
        },

        newAgency: {

            get addNewAgencyBtn() {
                return $("span=Add new agency");
