            get passwordInput() {
                return $("[name='password']");
            },
            get confirmPasswordInput() {
                return $("[name='confirmPassword']");
            },
            get firstNameInput() {
                return $("[name='firstName']");
            },
            get lastNameInput() {
                return $("[name='lastName']");
            }
        },

        editPartner: {

            get filterLabel() {
                return $("div=Filter");
            },
            get userInput() {
                return $("[name='user']");
