            get roleDropdown() {
                return $(".dropdown--multi__toggle");
            },

            selectRole(role) {
                this.roleDropdown.click();
                $(".dropdown--multi__body")
                    .$(`span*=${role}`).click();
                this.roleDropdown.click();
            },

            get resetPasswordGenerateBtn() {
                return $("button=Generate");
            },
            get copyNewPasswordBtn() {
                return $(".icon--copy");
