import { mobileAdministrationLogout } from "../../common/Common.page";

class MobileAdminGP {

    cashRegister = {
        get newPlayerBtn() {
            return $(".nav--linkbox").$("div=New player");
        },
        newPlayer: {
            get createBtn() {
                return $("button[title='Create']");
            },
            get username() {
                return $("[name='userName']");
            },
            get password() {
                return $("[name='password']");
            },
            get createAccountBtn() {
                return $("button[title='Create Account']");
            }
        }
    }

    financesOverview = {
        get financesOverviewBtn() {
            return $(".nav--linkbox").$("div=Finances overview");
        }
    }

    home = {
        get logoutBtn() {
            return $("span=Logout");
        }
    }

    menuItems = {
        get agencyMenuItem() {
            return $(".l--nav").$('span=Agency');
        },
        get shopMenuItem() {
            return $(".l--nav").$('span=Shop');
        },
        get financesOverviewMenuItem() {
            return $(".l--nav").$('span=Finances');
        },
        get betsMenuItem() {
            return $(".l--nav").$('span=Bets');
        },
        get userActivitiesMenuItem() {
            return $(".l--nav").$('span=User activities');
        },
        get PartnersMenuItem() {
            return $(".l--nav").$('span=Partners');
        },
        get companySelectorMenuItem() {
            return $(".l--nav").$('span=Company');
        },
        get languageMenuItem() {
            return $(".l--nav").$('span=Language');
        },
        get logOutMenuItem() {
            return $(".l--nav").$('span=Logout');
        },
        get cashRegisterItem() {
            return $(".l--nav").$("span=Cash register");
        },
    }

    agency = {
        main: {
            get newAgencyBtn() {
                return $(".nav--linkbox").$('div=New agency');
            },
            get newAgentPartnerBtn() {
                return $(".nav--linkbox").$('div=New agent partner');
            },
            get editPartnerBtn() {
                return $(".nav--linkbox").$('div=Edit partner');
            },
            get depositWithdrawalBtn() {
                return $(".nav--linkbox").$('div=Deposit / Withdrawal');
            },
            get agencyManagementBtn() {
                return $(".nav--linkbox").$('div=Agency management');
            }
        },

        newAgency: {

            get addNewAgencyBtn() {
                return $("span=Add new agency");
            },
            get agencyNameInput() {
                return $("[name='name']");
            },
            get agencyAddressInput() {
                return $("[name='address']");
            }
        },

        newAgentPartner: {

            get usernameInput() {
                return $("[name='userName']");
            },
            get passwordInput() {
                return $("[name='password']");
            },
            get confirmPasswordInput() {
                return $("[name='confirmPassword']");
            },
            get firstNameInput() {
                return $("[name='firstName']");
            },
            get lastNameInput() {
                return $("[name='lastName']");
            }
        },

        editPartner: {

            get filterLabel() {
                return $("div=Filter");
            },
            get userInput() {
                return $("[name='user']");
            },
            get roleDropdown() {
                return $(".dropdown--multi__toggle");
            },

            selectRole(role) {
                this.roleDropdown.click();
                $(".dropdown--multi__body")
                    .$(`span*=${role}`).click();
                this.roleDropdown.click();
            },

            get resetPasswordGenerateBtn() {
                return $("button=Generate");
            },
            get copyNewPasswordBtn() {
                return $(".icon--copy");
            },
            get activePartnerBtn() {
                return $(".k-switch-label-on");
            },
            get inactivePartnerBtn() {
                return $(".k-switch-label-off");
            }
        },

        depositWithdrawal: {

            get userInput() {
                return $("[name='user']");
            },
            get roleDropdown() {
                return $(".dropdown--multi__toggle");
            },
            get searchBtn() {
                return $("button[title='Search'] > .btn__label");
            },

            selectRole(role) {
                this.roleDropdown.click();
                $(".dropdown--multi__body")
                    .$(`span*=${role}`).click();
                this.roleDropdown.click();
            },
            get depositBtn() {
                return $("button[title='Deposit']");
            },
            get payoutBtn() {
                return $("button[title='Payout']");
            },
            get detailTab() {
                return $(".tabs--primary").$("a=Details");
            },
            get lastTransactionsTab() {
                return $(".tabs--primary").$("a=Last transactions");
            }
        },

        agencyManagement: {
            get activeAgencyBtn() {
                return $(".k-switch-label-on");
            },
            get inactiveAgencyBtn() {
                return $(".k-switch-label-off");
            },
            selectCurrency(currency) {
                $("span=Select a currency").click();
                $(currency).click();

            }
        }
    }

    bets = {
        main: {
            get betsOverviewBtn() {
                return $(".nav--linkbox").$("div=Bets overview");
            },
            get cashinoOverviewBtn() {
                return $(".nav--linkbox").$("div=Casino overview");
            },
            get searchByIdBtn() {
                return $(".nav--linkbox").$("div=Search by Id");
            },
            get searchBtn() {
                return $(".nav--linkbox").$("div=Search");
            },
            get betSlipsForPayoutBtn() {
                return $(".nav--linkbox").$("div=Betslips for payout");
            },
            get criticalBetSlipsBtn() {
                return $(".nav--linkbox").$("div=Critical betslips");
            },
            get turnoverReportBtn() {
                return $(".nav--linkbox").$("div=Turnover report");
            },
        },

        searchByID: {

            get betSlipNumberInput() {
                return $(".input");
            },
            get searchBtn() {
                return $("button[title='Search']");
            }
        }
    }

    common = {
        filter: {

            selectShopMenu: {
                get selectAllBtn() {
                    return $("button=Select All");
                },
                get clearBtn() {
                    return $("button[title='Clear']");
                },

                selectCentral(central) {
                    $(".rc-tree-list-holder-inner")
                        .$(`span*=${central}`).click();
                },
                selectshop(central, agency, shop) {
                    const selectCentral = $(".rc-tree-list-holder-inner").$(`span*=${central}`);
                    selectCentral.waitForClickable();
                    selectCentral.click();

                    const selectAgency = $(".rc-tree-list-holder-inner").$(`span*=${agency}`);
                    selectAgency.waitForClickable();
                    selectAgency.click();

                    const selectShop = $(".rc-tree-list-holder-inner").$(`span*=${shop}`);
                    selectShop.waitForClickable();
                    selectShop.click();
                },
            },

            dateRangePicker: {
                get startDateBtn() {
                    return $(".form__group:nth-child(1) [placeholder='Select time']");
                },
                get endDateBtn() {
                    return $(".form__group:nth-of-type(2)");
                },
                get confirmBtn() {
                    return $(".datepicker-navbar").$('a=Confirm');
                },
                selectDay(day) {
                    $(`li=${day}`).click();
                },

                selectMonth(month) {
                    $(`li=${month}`).click();
                },

                selectYear(year) {
                    debugger
                    const datePickerContent = $("[data-new-gr-c-s-check-loaded] .Modal-Portal:nth-child(16) [class='datepicker-col-1']:nth-of-type(3) .datepicker-scroll");
                    datePickerContent.selectByVisibleText(year)
                },
            },

            get displayBtn() {
                return $(".l--footer").$("button=Display");
            },
        },

        search() {
            const searchButton = $("button[title='Search']");
            searchButton.waitForClickable();
            searchButton.click();
        },

        logoutIfLoggedIn() {
            const signInBtn = $("span=Sign In");
            const signInIsVisible = signInBtn.isDisplayed();
            if (!signInIsVisible) {
                mobileAdministrationLogout();
                browser.refresh();
            } else {
                return;
            }
        }
    }

    partners = {
        get transactionHistoryBtn() {
            return $(".nav--linkbox").$("div=Transaction history");
        },
        get filterBtn() {
            return $("button[title='Filter']");
        }
    }

    shop = {
        main: {
            get newShopBtn() {
                return $(".nav--linkbox").$("div=New shop");
            },
            get newShopPartnerBtn() {
                return $(".nav--linkbox").$("div=New shop partner");
            },
            get newCashierBtn() {
                return $(".nav--linkbox").$("div=New cashier");
            },
            get depositWithdrawalBtn() {
                return $(".nav--linkbox").$("div=Deposit / Withdrawal");
            },
            get shopManagementBtn() {
                return $(".nav--linkbox").$("div=Shop management");
            },
        },

        newShop: {

            selectCentral(central) {
                $(".l--content")
                    .$(`span*=${central}`).click();
            },
            get centralTitle() {
                return $(".nav--linkbox--inline")
                    .$("div*=HR Central");
            },
            get addNewShopBtn() {
                return $("span=Add new shop");
            },
            get shopNameInput() {
                return $("[name='name']");
            },
            get shopAddressInput() {
                return $("[name='street']");
            },
            get pinNumberInput() {
                return $("[name='cardPin']");
            },
            get saveBtn() {
                return $("[type='submit']");
