import { mobileTwAdministration } from "../../../../env/environment";
import { mobileAdministrationTwSelectCompany, randomStringNum, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminTW } from "../../../../pageobjects/mobile-administration/GP";

describe("MOBILE ADMIN - AGENCY", () => {

    describe("NEW AGENCY TESTS", () => {

        it("Open agency page, verify page does not crash", () => {
            mobileTwAdministration();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.agencyMenuItem.click();
        });

        it("Open new agency page, verify page does not crash", () => {
            MobileAdminTW.agency.main.newAgencyBtn.click();
            const centralName = $("span=HR Central");
            verifyIsVisible(centralName);
        });

        it("Select Central, verify page is opened", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.newAgencyBtn.click();
            const centralName = $("span=HR Central");
            centralName.waitForClickable();
            centralName.click();
            const agencyname = $("div=MonoQA");
            verifyIsVisible(agencyname);
            verifyIsVisible(MobileAdminTW.agency.newAgency.addNewAgencyBtn);

        });

        it("Open Agency create page", () => {
            MobileAdminTW.agency.newAgency.addNewAgencyBtn.waitForClickable();
            MobileAdminTW.agency.newAgency.addNewAgencyBtn.click();
        });

        it("Create an agency, verify", () => {
            const randomAgencyNum = randomStringNum();
            MobileAdminTW.agency.newAgency.agencyNameInput.addValue(`Automated${randomAgencyNum}`);
            MobileAdminTW.agency.newAgency.agencyAddressInput.addValue('address');
            MobileAdminTW.agency.agencyManagement.selectCurrency("li=Euro (EUR)");
            /* $("[type='submit']").click();
            verifyIsVisible($("div=Agency created successfully")); */  //Remove comment if you want to create agencies
        });
    });

    describe("NEW AGENT PARTNER TESTS", () => {

        it("Open new agent partner page", () => {

            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.newAgentPartnerBtn.click();
        });

        it("Create agent partner", () => {
            MobileAdminTW.agency.newAgentPartner.usernameInput.addValue(`autoAgentPartner${randomStringNum()}`);
            MobileAdminTW.agency.newAgentPartner.passwordInput.addValue('mono.123');
            MobileAdminTW.agency.newAgentPartner.confirmPasswordInput.addValue('mono.123');
            MobileAdminTW.agency.newAgentPartner.firstNameInput.addValue(randomStringNum());
            MobileAdminTW.agency.newAgentPartner.lastNameInput.addValue(randomStringNum());
            const central = $('span=HR Central');
            central.click();
            const agency = $('span=MonoQA');
            agency.click();
            $("[type='submit'] .btn__label").click();
            const successToastMessage = $("div=Agency Partner created successfully");
            verifyIsVisible(successToastMessage);
            browser.pause(1000);
        });
    });

    describe("EDIT PARTNER TESTS", () => {
        it("Open Edit partner page, verify page is opened", () => {


            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            verifyIsVisible(MobileAdminTW.agency.editPartner.userInput);
            verifyIsVisible(MobileAdminTW.agency.editPartner.filterLabel);
            verifyIsVisible(MobileAdminTW.agency.editPartner.roleDropdown);
        });

        const backButton = ".icon--arrow-left";
        const firstFilteredResult = ".list--primary > div > div:nth-of-type(1)";

        it("Verify Agent roles are filtered", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            MobileAdminTW.agency.editPartner.selectRole('Agent');
            MobileAdminTW.common.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Agent");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify Shop Manager roles are filtered", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            MobileAdminTW.agency.editPartner.selectRole('Shop manager');
            MobileAdminTW.common.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Betting Shop Manager");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify Cashier roles are filtered", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            MobileAdminTW.agency.editPartner.selectRole('Cashier');
            MobileAdminTW.common.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Cashier");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify Partner roles are filtered", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            MobileAdminTW.agency.editPartner.selectRole('Partner');
            MobileAdminTW.common.search();

            $(firstFilteredResult).click();

            const roleElement = $(".card--primary__body").$("div*=Partner");
            verifyIsVisible(roleElement);
            $(backButton).click();
        });

        it("Verify new password was generated", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            MobileAdminTW.agency.editPartner.selectRole('Partner');
            MobileAdminTW.common.search();

            $(firstFilteredResult).click();

            MobileAdminTW.agency.editPartner.resetPasswordGenerateBtn.click();
            const newPasswordLabel = $("span=New Password");
            const newPasswordBox = $(".spc--top--sml");
            verifyIsVisible(newPasswordLabel);
            verifyIsVisible(newPasswordBox);
        });

        it("Verify new password can be copied", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            MobileAdminTW.agency.editPartner.selectRole('Partner');
            MobileAdminTW.common.search();
            $(firstFilteredResult).click();
            MobileAdminTW.agency.editPartner.resetPasswordGenerateBtn.click();
            MobileAdminTW.agency.editPartner.copyNewPasswordBtn.waitForClickable();
            MobileAdminTW.agency.editPartner.copyNewPasswordBtn.click();
            const successfullToastMessage = $("div*=Copied text");
            verifyIsVisible(successfullToastMessage);
        });

        it("Verify activation and deactivation", () => {
            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.editPartnerBtn.click();
            MobileAdminTW.agency.editPartner.selectRole('Partner');
            MobileAdminTW.common.search();
            $(firstFilteredResult).click();
            const lockedUserMessage = $("div=User locked successfully");
            const unlockedUserMessage = $("div=User unlocked successfully");
            MobileAdminTW.agency.editPartner.activePartnerBtn.click();
            verifyIsVisible(lockedUserMessage);
            MobileAdminTW.agency.editPartner.inactivePartnerBtn.click();
            verifyIsVisible(unlockedUserMessage);
        });
    });

    describe("DEPOSIT / WITHDRAWAL TESTS", () => {

        it("Open deposit and withdrawal page, verify page is opened", () => {

            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.depositWithdrawalBtn.click();
            verifyIsVisible(MobileAdminTW.agency.depositWithdrawal.roleDropdown);
            verifyIsVisible(MobileAdminTW.agency.depositWithdrawal.userInput);
        });

        it("Search all users, verify results are loaded", () => {
            MobileAdminTW.agency.depositWithdrawal.searchBtn.waitForClickable();
            MobileAdminTW.agency.depositWithdrawal.searchBtn.click();
            verifyIsVisible($(".list--primary"));
        });

        it("Select a user, verify user page is opened", () => {
            const firstFilteredResult = ".list--primary > div > div:nth-of-type(1)";
            $(firstFilteredResult).click();
        });

        it("Deposit to account, verify request was a success", () => {
            const value20 = $("div=20");
            const depositSuccessfullMessage = $("div=Deposit successful");
            const withdrawalSuccessfullMessage = $("div=Withdrawal successful");

            value20.waitForClickable();
            value20.click();
            MobileAdminTW.agency.depositWithdrawal.depositBtn.click();
            verifyIsVisible(depositSuccessfullMessage);

            MobileAdminTW.agency.depositWithdrawal.payoutBtn.waitForClickable();
            MobileAdminTW.agency.depositWithdrawal.payoutBtn.click();
            verifyIsVisible(withdrawalSuccessfullMessage);
        });

    });

    describe("AGENCY MANAGEMENT TESTS", () => {

        it("Open agency management page, verify page is opened", () => {

            MobileAdminTW.menuItems.agencyMenuItem.click();
            MobileAdminTW.agency.main.agencyManagementBtn.click();
            verifyIsVisible($("div=Agency management"));
        });

        it("Open an agency, verify page is opened", () => {
            $("span=HR Central").waitForClickable();
            $("span=HR Central").click();
            $("div=MonoQA").click();

            const agencyName = $(".card--primary__body").$("div=MonoQA");
            verifyIsVisible(agencyName);
        });

        it("Activate and deactivate agencies, verify messages", () => {
            const agencyDeactivatedMessage = $("div=Agency deactivated successfully");
            const agencyActivatedMessage = $("div=Agency activated successfully");
            const displayedActiveAgencyBtn = MobileAdminTW.agency.agencyManagement.activeAgencyBtn.isDisplayed();

            if (!displayedActiveAgencyBtn) {
                MobileAdminTW.agency.agencyManagement.inactiveAgencyBtn.click();
            } else {
                return;
            }

            MobileAdminTW.agency.agencyManagement.activeAgencyBtn.waitForClickable();
            MobileAdminTW.agency.agencyManagement.activeAgencyBtn.click();
            verifyIsVisible(agencyDeactivatedMessage);
            MobileAdminTW.agency.agencyManagement.inactiveAgencyBtn.waitForClickable();
            MobileAdminTW.agency.agencyManagement.inactiveAgencyBtn.click();
            verifyIsVisible(agencyActivatedMessage);
        });
    });
});

