import { mobileTwAdministration } from "../../../../env/environment";
import { mobileAdministrationTwSelectCompany, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminTW } from "../../../../pageobjects/mobile-administration/GP";


describe("MOBILE ADMIN BETS", () => {
    describe("BETS OVERVIEW TESTS", () => {

        it("Open bets overview page, verify page is loaded", () => {
            mobileTwAdministration();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.betsMenuItem.click();
            MobileAdminTW.bets.main.betsOverviewBtn.waitForClickable();
        });

        it("Verify all page buttons are visible", () => {
            verifyIsVisible(MobileAdminTW.bets.main.betsOverviewBtn);
            verifyIsVisible(MobileAdminTW.bets.main.cashinoOverviewBtn);
            verifyIsVisible(MobileAdminTW.bets.main.searchByIdBtn);
            verifyIsVisible(MobileAdminTW.bets.main.searchBtn);
            verifyIsVisible(MobileAdminTW.bets.main.betSlipsForPayoutBtn);
            verifyIsVisible(MobileAdminTW.bets.main.criticalBetSlipsBtn);
            verifyIsVisible(MobileAdminTW.bets.main.turnoverReportBtn);
        });

        it("Open bets overview page, filter results", () => {
            MobileAdminTW.bets.main.betsOverviewBtn.click();
            MobileAdminTW.common.filter.selectShopMenu.selectAllBtn.click();
            MobileAdminTW.common.filter.displayBtn.click();
            const resultheader = $(".k-grid-header");
            verifyIsVisible(resultheader);
        });

    });

    describe("CASINO OVERVIEW TESTS", () => {
        it("Open casino overview page, verify page is loaded", () => {

            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.betsMenuItem.click();
            MobileAdminTW.bets.main.cashinoOverviewBtn.waitForClickable();
        });

        it("Open casino overview page, filter results", () => {
            MobileAdminTW.bets.main.cashinoOverviewBtn.click();
            MobileAdminTW.common.filter.selectShopMenu.selectAllBtn.click();
            $("button[title='Search']").click();
        });

    });

    describe("SEARCH BY ID TESTS", () => {
        it("Open search by id page, verify page is loaded", () => {

            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.betsMenuItem.click();
            MobileAdminTW.bets.main.searchByIdBtn.waitForClickable();
        });

        it("Search for a bet slip, verify page is loaded", () => {
            MobileAdminTW.bets.main.searchByIdBtn.click();
            MobileAdminTW.bets.searchByID.betSlipNumberInput.addValue('3-47275');
            MobileAdminTW.bets.searchByID.searchBtn.doubleClick();
            const betslipHeaderInfo = $(".table__head").$("span*=3-47275");
            verifyIsVisible(betslipHeaderInfo);
        });

        it("Click the header back button, verify page is loaded", () => {
            const headerBackBtn = $(".icon--arrow-left");
            headerBackBtn.click();
            verifyIsVisible(MobileAdminTW.bets.searchByID.betSlipNumberInput);
        });


    });

    describe("SEARCH TESTS", () => {
        it("Open search page, verify page is loaded", () => {

            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.betsMenuItem.click();
            MobileAdminTW.bets.main.searchBtn.waitForClickable();
        });

        it("Open search bets page, verify page is loaded", () => {
            MobileAdminTW.bets.main.searchBtn.click();
            verifyIsVisible(MobileAdminTW.common.filter.selectShopMenu.selectAllBtn);
            MobileAdminTW.common.filter.selectShopMenu.selectAllBtn.click();
        });

    });

    describe("BET SLIPS FOR PAYOUT TESTS", () => {

        it("Open bets slips for payout page, verify page is loaded", () => {

            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.betsMenuItem.click();
            MobileAdminTW.bets.main.betSlipsForPayoutBtn.waitForClickable();
        });

        it("Filter bet slips, verify items are loaded", () => {
            MobileAdminTW.bets.main.betSlipsForPayoutBtn.click();
            MobileAdminTW.common.filter.selectShopMenu.selectAllBtn.click();
            MobileAdminTW.common.filter.displayBtn.click();
        });

        it("Open a result, verify page is loaded", () => {
            $("tr:nth-of-type(1) > .c-poiner.type--link").click();
            const forPayoutTitle = $(".table__head__data.type--left").$("span*=For Payout ");
            verifyIsVisible(forPayoutTitle);
        });
    });

    describe("CRITICAL BET SLIPS TESTS", () => {
        it("Open critical bets slips page, verify page is loaded", () => {

            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.betsMenuItem.click();
            MobileAdminTW.bets.main.criticalBetSlipsBtn.waitForClickable();

        });

        it("Filter results, verify results are displayed", () => {
            const firstCentralChekbox = $(".rc-tree-list-holder-inner .rc-tree-treenode-switcher-close:nth-of-type(1) .rc-tree-checkbox");
            const secondCentralCheckbox = $(".rc-tree-treenode.rc-tree-treenode-leaf-last.rc-tree-treenode-switcher-close > .rc-tree-checkbox");

            MobileAdminTW.bets.main.criticalBetSlipsBtn.click();
            verifyIsVisible(MobileAdminTW.common.filter.selectShopMenu.clearBtn)
            firstCentralChekbox.click();
            secondCentralCheckbox.click();
            MobileAdminTW.common.filter.displayBtn.click();
            const header = $("table > .k-grid-header")
            verifyIsVisible(header);
        });

        it("Open a result verify page is loaded", () => {
            const firstResultElement = $("tr:nth-of-type(1) > .c-poiner.type--link");
            firstResultElement.click();
            verifyIsVisible($(".dropdown--multi"));
        });
    });

    describe("TURNOVER REPORT TESTS", () => {
        it("Open turnover report page, verify page is loaded", () => {

            MobileAdminTW.menuItems.menuBtn.click();
            MobileAdminTW.menuItems.menu.betsMenuItem.click();
            MobileAdminTW.bets.main.turnoverReportBtn.waitForClickable();
        });

        it("Open tournover report page, verify page is loaded", () => {
            MobileAdminTW.bets.main.turnoverReportBtn.click();
            verifyIsVisible(MobileAdminTW.common.filter.selectShopMenu.selectAllBtn);
        });

        it("Filter results, verify page is loaded", () => {
            MobileAdminTW.common.filter.selectShopMenu.selectAllBtn.click();
            MobileAdminTW.common.filter.displayBtn.click();
            const tableHeader = $(".k-grid-header .k-header:nth-of-type(1) .k-link");
            verifyIsVisible(tableHeader);
        });
    });

});

