import { mobileTwAdministration } from "../../../../env/environment";
import { mobileAdministrationTwSelectCompany, randomStringNum, verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { MobileAdminGP, MobileAdminTW } from "../../../../pageobjects/mobile-administration/GP";
describe("MOBILE ADMIN - SHOP", () => {
    describe("NEW SHOP TESTS", () => {

        it("Open new Shop page, verify page does not crash", () => {
            mobileTwAdministration();
            MobileAdminTW.login.logIn("SuperAdmin", "B@@sicSup3rAdm1n");
            mobileAdministrationTwSelectCompany();
            MobileAdminTW.menuItems.shopMenuItem.click();
            verifyIsVisible(MobileAdminTW.shop.main.newCashierBtn);
            verifyIsVisible(MobileAdminTW.shop.main.depositWithdrawalBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopPartnerBtn);
            verifyIsVisible(MobileAdminTW.shop.main.shopManagementBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopBtn);
            MobileAdminTW.shop.main.newShopBtn.click();
        });

        it("Select central, verify agencies are loaded", () => {
            const agency = $("div=MonoQA");
            MobileAdminTW.shop.newShop.selectCentral("HR Central");
            verifyIsVisible(MobileAdminTW.shop.newShop.centralTitle);
            agency.click();
        });

        it("Create shop, verify it is a success", () => {

            const agency = $("div=MonoQA");
            MobileAdminTW.menuItems.shopMenuItem.click();
            MobileAdminTW.shop.main.newShopBtn.click();
            MobileAdminTW.shop.newShop.selectCentral("HR Central");
            browser.pause(1000);
            agency.waitForClickable();
            agency.click();
            MobileAdminTW.shop.newShop.addNewShopBtn.click();
            const randomShop = `Autoshop${randomStringNum()}`;
            MobileAdminTW.shop.newShop.shopNameInput.addValue(randomShop);
            MobileAdminTW.shop.newShop.shopAddressInput.addValue("addrX");
            MobileAdminTW.shop.newShop.pinNumberInput.addValue("1111");
            MobileAdminTW.shop.newShop.saveBtn.click();
            verifyIsVisible(MobileAdminTW.shop.newShop.shopCreatedToastMessage);

            const createdShop = $(".nav--linkbox--inline").$(`div*=${randomShop}`);
            createdShop.waitForDisplayed();
            verifyIsVisible(createdShop);

        });


    });
    describe("NEW SHOP PARTNER TESTS", () => {

        it("Open new Shop partner page, verify page does not crash", () => {

            MobileAdminTW.menuItems.shopMenuItem.click();
            verifyIsVisible(MobileAdminTW.shop.main.newCashierBtn);
            verifyIsVisible(MobileAdminTW.shop.main.depositWithdrawalBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopPartnerBtn);
            verifyIsVisible(MobileAdminTW.shop.main.shopManagementBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopBtn);
            MobileAdminTW.shop.main.newShopPartnerBtn.click();
        });

        it("Verify shop partner creation page", () => {
            verifyIsVisible(MobileAdminTW.shop.newShopPartner.usernameInput);
            verifyIsVisible(MobileAdminTW.shop.newShopPartner.confirmPasswordInput);
            verifyIsVisible(MobileAdminTW.shop.newShopPartner.passwordInput);
            verifyIsVisible(MobileAdminTW.shop.newShopPartner.firstNameInput);
            verifyIsVisible(MobileAdminTW.shop.newShopPartner.lastNameInput);
        });

        it("Verify partner is created", () => {
            MobileAdminTW.shop.newShopPartner.usernameInput.addValue(`partner${randomStringNum()}`);
            MobileAdminTW.shop.newShopPartner.passwordInput.addValue('mono.123');
            MobileAdminTW.shop.newShopPartner.confirmPasswordInput.addValue('mono.123');
            MobileAdminTW.shop.newShopPartner.firstNameInput.addValue("aeifha");
            MobileAdminTW.shop.newShopPartner.lastNameInput.addValue("adfawf");
            MobileAdminTW.shop.newShopPartner.selectshop("HR Central", "MonoQA", "Vanja");
            MobileAdminTW.shop.newShopPartner.saveBtn.click();

            verifyIsVisible($("div*=Agency Partner created successfully"));

        });

    });

    describe("NEW CASHIER TESTS", () => {
        it("Open new Shop partner page, verify page does not crash", () => {

            MobileAdminTW.menuItems.shopMenuItem.click();
            verifyIsVisible(MobileAdminTW.shop.main.newCashierBtn);
            verifyIsVisible(MobileAdminTW.shop.main.depositWithdrawalBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopPartnerBtn);
            verifyIsVisible(MobileAdminTW.shop.main.shopManagementBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopBtn);
            MobileAdminTW.shop.main.newCashierBtn.click();
        });

        it("Verify new cashier page", () => {
            verifyIsVisible(MobileAdminTW.shop.newCashier.usernameInput);
            verifyIsVisible(MobileAdminTW.shop.newCashier.passwordInput);
            verifyIsVisible(MobileAdminTW.shop.newCashier.confirmPasswordInput);
            verifyIsVisible(MobileAdminTW.shop.newCashier.firstnameInput);
            verifyIsVisible(MobileAdminTW.shop.newCashier.lastNameInput);
            verifyIsVisible(MobileAdminTW.shop.newCashier.emailInput);
        });

        it("Create a new cashier", () => {
            const randomCashier = `cashier${randomStringNum()}`;
            MobileAdminTW.shop.newCashier.usernameInput.addValue(randomCashier);
            MobileAdminTW.shop.newCashier.passwordInput.addValue("mono.123");
            MobileAdminTW.shop.newCashier.confirmPasswordInput.addValue("mono.123");
            MobileAdminTW.shop.newCashier.firstnameInput.addValue("asdasd");
            MobileAdminTW.shop.newCashier.lastNameInput.addValue("asdasd");
            MobileAdminTW.shop.newCashier.emailInput.addValue(`${randomCashier}@summail.haer`);
            MobileAdminTW.shop.newCashier.addMailBtn.click();
            MobileAdminTW.shop.newCashier.selectshop("HR Central", "MonoQA", "Vanja");
            $("span=Save").click();
            verifyIsVisible($("div=Cashier created successfully"));

        });
    });

    describe("DEPOSIT / WITHDRAWAL TESTS", () => {

        it("Open new Shop partner page, verify page does not crash", () => {

            MobileAdminTW.menuItems.shopMenuItem.click();
            verifyIsVisible(MobileAdminTW.shop.main.newCashierBtn);
            verifyIsVisible(MobileAdminTW.shop.main.depositWithdrawalBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopPartnerBtn);
            verifyIsVisible(MobileAdminTW.shop.main.shopManagementBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopBtn);
            MobileAdminTW.shop.main.depositWithdrawalBtn.click();
        });

        it("Search all users, verify results are loaded", () => {
            MobileAdminTW.shop.depositWithdrawal.searchBtn.waitForClickable();
            MobileAdminTW.shop.depositWithdrawal.searchBtn.click();
            verifyIsVisible($(".list--primary > div > div:nth-of-type(1)"));
        });

        it("Select a user, verify user page is opened", () => {
            const firstFilteredResult = ".list--primary > div > div:nth-of-type(1)";
            $(firstFilteredResult).click();
        });

        it("Deposit to account, verify request was a success", () => {
            const value20 = $("div=20");
            const depositSuccessfullMessage = $("div=Deposit successful");
            const withdrawalSuccessfullMessage = $("div=Withdrawal successful");

            value20.waitForClickable();
            value20.click();
            MobileAdminTW.shop.depositWithdrawal.depositBtn.click();
            verifyIsVisible(depositSuccessfullMessage);

            MobileAdminTW.shop.depositWithdrawal.payoutBtn.waitForClickable();
            MobileAdminTW.shop.depositWithdrawal.payoutBtn.click();
            verifyIsVisible(withdrawalSuccessfullMessage);

        });

    });
    describe("SHOP MANAGEMENT TESTS", () => {

        it("Open new Shop partner page, verify page does not crash", () => {

            MobileAdminTW.menuItems.shopMenuItem.click();
            verifyIsVisible(MobileAdminTW.shop.main.newCashierBtn);
            verifyIsVisible(MobileAdminTW.shop.main.depositWithdrawalBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopPartnerBtn);
            verifyIsVisible(MobileAdminTW.shop.main.shopManagementBtn);
            verifyIsVisible(MobileAdminTW.shop.main.newShopBtn);
            MobileAdminTW.shop.main.shopManagementBtn.click();
        });

        it("Select a shop", () => {
            MobileAdminTW.shop.shopManagement.selectshop("HR Central", "MonoQA", "Autotest");
            const shopName = $(".card--primary__row--shop").$("div=Autotest");
            const companyName = $(".card--primary__row--company").$("div=TW");
            const centralName = $(".card--primary__row--central").$("div=HR Central");
            const agencyName = $(".card--primary__row--agency").$("div=MonoQA");
            verifyIsVisible(shopName);
            verifyIsVisible(companyName);
            verifyIsVisible(centralName);
            verifyIsVisible(agencyName);
        });

        it("Verify shop is activated and deactivated", () => {

            MobileAdminTW.menuItems.shopMenuItem.click();
            MobileAdminTW.shop.main.shopManagementBtn.click();
            MobileAdminTW.shop.shopManagement.selectshop("HR Central", "MonoQA", "Autotest");
            const switcher = $(".k-switch-handle");
            switcher.click();
            const activatedToast = $("div=Shop activated successfully");
            const deactivatedToast = $("div=Shop deactivated successfully");
            switcher.click();
            verifyIsVisible(activatedToast);
            verifyIsVisible(deactivatedToast);
        });
    });
});

