import { webTwDeV2 } from "../../../../env/environment";
import { verifyIsVisible } from "../../../../pageobjects/common/Common.page";
import { Header, LoginPage } from "../../../../pageobjects/web/web-v2";

describe("Submit Slip", () => {


    const username = "at-007";
    const password = "Mono.123"

    it("Login to web, submit a slip", () => {
        webTwDeV2();
        Header.loginBtn.click();
        LoginPage.usernameInput.addValue(username);
        LoginPage.passwordInput.addValue(password);
        LoginPage.loginBtn.click();
        const continueBtn = $("button=Continue");
        const headerUserDisplay = $("div=at-007");
        continueBtn.waitForClickable();
        continueBtn.click();
        headerUserDisplay.waitForDisplayed();
        verifyIsVisible(headerUserDisplay);
        browser.url("http://qa.de.web.gp.develop/en/sports/full/event/jrJcquNKQKohfwsD0GaZ83");

        const oneClickBetBtn = $("button=One-click bet");
        const deactivateBtn = $("button=Deactivate");
        const quota = $('button=122');
        const submittedToastMsg = $("div=Bet slip submitted");

        oneClickBetBtn.waitForClickable();
        oneClickBetBtn.click();
        browser.pause(1000);
        deactivateBtn.waitForClickable();
        quota.waitForClickable();
        quota.click();
        verifyIsVisible(submittedToastMsg);

        Header.profilePic.click();
        Header.userDisplay.logoutBtn.click();
        verifyIsVisible(Header.loginBtn);
    });
});

