        webTwDeV2();
        Header.searchEvent("real");
        SportMenu.burgerBtn.click();
        const expandedMenu = $(".sidebar-left-expanded");
        const collapsedMenu = $(".l--aside--left");
        verifyIsVisible(collapsedMenu);
        SportMenu.burgerBtn.click();
        verifyIsVisible(expandedMenu);
    });
    //https://projects.mono-software.com/issues/80431
    it("Multiple session logout and message missing", () => {
        browser.url("http://qa.de.web.gp.develop/en/Membership/Authentication/Login?isSessionTerminated=true");
